import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import HomePage from "./HomePage";
function MyApp() {
  return (
    <div>
      <h1>My list!</h1>
      <ul>
        <li>hi</li>
        <li>I'am</li>
        <li>jishnu</li>
      </ul>
    </div>
  );
}
ReactDOM.render(<MyApp />, document.getElementById("root"));
